import { Dispatch, SetStateAction } from "react";
import {Guess} from "./Guess";


const CheckGuess = (
  words: string[],
  guess: Guess,
  idx: number,
  setIsCorrect: Dispatch<SetStateAction<boolean>>
): void => {
  const correctWord = words[idx];
  const tOrF = new Set(correctWord).size === new Set(correctWord + guess.v + guess.c).size;
  return 1;
